// src/App.js
import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Assessment from './Assessment';
import './styles.css';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="content">
        <Assessment />
      </div>
      <Footer />
    </div>
  );
}

export default App;
